import React , { useEffect , useState } from 'react';

function Usuario () {
	
	const [ usuario , setUsuario ] = useState();
	
	useEffect(() => {
		fetch( "https://randomuser.me/api/" )
		.then( x => x.json() )
		.then( x => {
			// var getUsuario = {
			// 	"genero" : results;
			// }
			console.log( x );
			console.log( x.results );
		});
	});

	return ( 
		<section className="usuario">
			<h2>Usuario</h2>
		</section>
	)
};

export default Usuario;
